import React from "react";

class DetailPost extends React.Component {
  render() {
    this.props.post.map((item, index) => {
      return (
        <div onClick={() => this.props.showPost(item.id)}>
          id={item.id}
          key={index}
          item={item}
        </div>
      );
    });
  }
}

export default DetailPost;
